import React from 'react';

const Header = () => {
    return (
      <div className="navbar bg-black shadow-lg " id="navbar">
        <div className="navbar-start">
          <div className="dropdown"></div>
          <a className=" normal-case text-3xl shadow-2xl text-green-900 font-bold">
            TETFLIX
          </a>
        </div>
        <div className="navbar-end ">
          <a className="btn bg-transparent hover:bg-green-950 shad">Language</a>
        </div>

        <button type="submit" className="navbar-end " value="sign-in">
          <a className="btn bg-green-900 hover:bg-black">Sign-in</a>
        </button>
      </div>
    );
};

export default Header;
